function App() {
  return (
    <div classNameName="App">
      <Router>
        <Header />
        <Switch>
          <Route path="/" exact component={Main} />
          <Route path="/about-us" component={AboutUs} />
          <Route path="/contact" component={Contact} />

          <Main />
        </Switch>

        <Footer />
      </Router>
    </div>
  );
}

export default App;
